import React from 'react';
import { Link } from 'react-router-dom'; // Para crear los enlaces de navegación

const Home = () => {
  return (
    <div className="container p-5">
      <h1 style={{ textAlign: 'center', color: 'white' }}>Bienvenido</h1>
      <h2 style={{ textAlign: 'center', color: 'white' }}>Seleccione una opción</h2>

      <div className="row">
        <div className="col text-center">
          <Link to="/productos" className="btn btn-primary btn-lg">
            Productos
          </Link>
        </div>
        <div className="col text-center">
          <Link to="/proveedores" className="btn btn-primary btn-lg">
            Proveedores
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
